import React, { Component } from 'react';
import antd,{Carousel} from 'antd';
import '../assets/css/Home.css'
class Home extends Component {
    render() {
        return (
            <Carousel autoplay>
            <div>
                        <ul>
                        <li>
            
                            <a href="https://freshdesignweb.com"><img src="https://www.w3schools.com/images/w3schools_green.jpg" alt="" title=""/></a>
            
                            <div class="flex-caption">
            
                                <div class="caption_title_line"><h2>Party Dresses</h2><p>If you are looking for something a little special for your big night out, check out Rare London's collection of stunning party dresses</p></div>
            
                            </div>
            
                        </li>
                        <li>
            
                            <a href="https://freshdesignweb.com"><img src="https://www.w3schools.com/images/w3schools_green.jpg" alt="" title=""/></a>
            
                            <div class="flex-caption">
            
                                <div class="caption_title_line"><h2>Party Dresses</h2><p>If you are looking for something a little special for your big night out, check out Rare London's collection of stunning party dresses</p></div>
            
                            </div>
            
                        </li>

                        </ul>
            </div>
          </Carousel>
        );
    }
}

export default Home;
